            twoToneColor="#e69915"
            style={{ fontSize: "35px", padding: "10px 3px" }}
          />
          <HeartTwoTone
            twoToneColor="#e69915"
            style={{ fontSize: "35px", padding: "10px 3px" }}
          />
          <HeartTwoTone
            twoToneColor="#e69915"
            style={{ fontSize: "35px", padding: "10px 3px" }}
          />
          <HeartTwoTone
            twoToneColor="#e69915"
            style={{ fontSize: "35px", padding: "10px 3px" }}
          />
        </div>
      </>
    );
  }
}

export default ShowFull;
